import React from 'react'

export const FileUPload = (handleFileChange, className, fileType) => {
    return (
        <div className={`upload-box${className ? ' ' + className : ''}`} onClick={handleFileChange}>
            <input
                type="file"
                multiple
                id="uploadFile"
                onChange={handleFileChange}
                accept={fileType}
            />
        </div>
    )
}
